import React from "react";
import "./Public.css";

const Home = () => {
  return (
    <>
      <header
        style={{
          backgroundColour: "black",
          textAlign: "center",
          padding: "8vh",
          marginBottom: "5vh",
        }}
      >
        TYS
      </header>
      <div className="main" style={{}}>
        <form>
          <div className="input">
            <label
              for="username"
              style={{
                width: "120px",
                padding: "10px",
              }}
            >
              Username:{" "}
            </label>
            <input placeholder="Username" />
          </div>
          <div className="input">
            <label
              for="password"
              style={{
                width: "120px",
                padding: "10px",
              }}
            >
              Password:{" "}
            </label>
            <input placeholder="Password" />
          </div>
          <button>Log in!</button>
        </form>
        <p>Don't have an account with us yet?</p>
      </div>
    </>
  );
};

export default Home;
